import React from 'react'

class OverlayMenu extends React.Component{
    render(){
        return(
            <div className="">
                <ul>
                    <li>Products</li>
                    <li>Services</li>
                    <li>About</li>
                </ul>
            </div>
        )
    }
}

export default OverlayMenu
